                </RegisterWrapper>
                {
                    modalOpen && <RegisterModal handleModal={handleModal} modalOpen={modalOpen}/>
                }
            </RegisterContainer>
        </>
    )


}

export default Register;

const RegisterContainer = styled.div`
    padding: 0 10px;
    color: black;
    cursor: pointer;
    &:hover {
        text: bold;
    }
`;

const RegisterWrapper = styled.div`

    &:hover {
        text: bold;
    }
`
